"use strict";(self.webpackChunkknowledge=self.webpackChunkknowledge||[]).push([[6927],{1913:(l,i,e)=>{e.r(i),e.d(i,{data:()=>a});const a={key:"v-2d0a776e",path:"/ai/",title:"算法工程师",lang:"zh-CN",frontmatter:{},excerpt:"",headers:[{level:3,title:"相关岗位",slug:"相关岗位",children:[]},{level:3,title:"互联网四大职位",slug:"互联网四大职位",children:[]},{level:3,title:"JD",slug:"jd",children:[]}],filePathRelative:"ai/README.md",git:{updatedTime:1656560982e3,contributors:[{name:"licong96",email:"licong19961204@gmail.com",commits:1}]}}},3802:(l,i,e)=>{e.r(i),e.d(i,{default:()=>t});const a=(0,e(6252).uE)('<h1 id="算法工程师" tabindex="-1"><a class="header-anchor" href="#算法工程师" aria-hidden="true">#</a> 算法工程师</h1><p>主流应用：音频、视频、图像、数据挖掘、搜索</p><p>技术核心：机器学习</p><p>未来：人工智能</p><h3 id="相关岗位" tabindex="-1"><a class="header-anchor" href="#相关岗位" aria-hidden="true">#</a> 相关岗位</h3><ol><li>研究员 <ul><li>博士起步，主要任务是看paper，研究前沿算法</li></ul></li><li>算法工程师： <ul><li>一般硕士起步，将已有的算法模型以代码的形式实现落地，产生实际的效应</li><li>比较关注工程，要对已有的算法有比较的了解</li></ul></li><li>数据分析师 <ul><li>一般硕士起步，寻找特征，分析数据，给算法工程师使用，更关注业务层</li><li>对代码的要求不高</li></ul></li><li>市场分析师 <ul><li>商科出身，对业务有更深的了解，分析市场与实际调研</li><li>对代码的要求进一步降低</li></ul></li></ol><h3 id="互联网四大职位" tabindex="-1"><a class="header-anchor" href="#互联网四大职位" aria-hidden="true">#</a> 互联网四大职位</h3><ol><li>开发工程师：有前端、后端，互联网公司最重要的岗位</li><li>数据工程师：有时与算法工程师混合，或者后端兼任</li><li>机器学习工程师：类似AI架构师，开发工程师加算法工程师，最顶尖的人才</li><li>产品经理：对产品进行设计，分析，项目。</li></ol><h3 id="jd" tabindex="-1"><a class="header-anchor" href="#jd" aria-hidden="true">#</a> JD</h3><p><strong>内功：</strong></p><ul><li>算法和数据结构</li><li>统计学</li><li>线性代数</li><li>微积分</li><li>机器学习模型</li><li>特征工程</li><li>自然语言处理</li><li>分布式计算</li></ul><p><strong>外功：</strong></p><ul><li>C++/Java</li><li>Python</li><li>Hadoop/Hive</li><li>Spark/MLlib</li><li>Mahout</li><li>SAS/SPSS</li><li>Weka/Stata</li><li>Mysql/MongoDB</li></ul><p>先学习怎么用，再学习怎么用好。从外功入手，再兼顾内功。在实践中学习，工科需要更多的练习，而且是贴近实际的练习。</p><p>LeetCode + Kaggle</p>',15),t={render:function(l,i){return a}}}}]);